import React from 'react';
import Dropzone from 'react-dropzone';

const ImportContainer = () => {
  return (
    <div className="import-container">
      <Dropzone>
        <section>
          <p>Drag n Drop</p>
        </section>
      </Dropzone>
    </div>
  )
};

export default ImportContainer;
